import React from "react";
import BeautyHeader from "./beautyheader";
import WomenHeader from "./womenheader";
import ShoesHeader from "./shoesheader";
import MenHeader from "./menheader";
import PetHeader from "./petheader";
import KidsHeader from "./kidsheader";
import ElectronicHeader from "./electronicheader";
import AddTheme from "./AddThemes";
import UpdateThemeImage from "./updateThemeImage";
import Header from "./header";
import GetItemInfo from "./getItemInfo";
import ItemDetail from "./getItemById";
import RemoveSizes from "./removeSize";

function ThemeAndInfo() {
    return (
        <div>
         <div>
                <AddTheme />
                <UpdateThemeImage/>
              <Header />
              <GetItemInfo/>
              <ItemDetail/>
              <RemoveSizes/>
              </div>
        </div>
    )
}

export default ThemeAndInfo
